import React from "react";
import { BannerWrap, BannerLeft, BannerRight } from "../styles/MapContainer";
import MapComponent from "../components/MapComponent";

function MapContainer() {
  return (
    <BannerWrap>
      <BannerLeft>
      <ReasonTitle>Зашто Мелодром?</ReasonTitle>
        <MainText>
                Зашто је за младе људе, оне које тек чека живот, да развију таленат за музику и сутрадан прерасте у јаку и задовољну личност?
            </MainText>
        <MapComponent />
      </BannerLeft>
      <BannerRight></BannerRight>
    </BannerWrap>
  );
}

export default MapContainer;
